INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Display','1','1206732366OVLY'),('Copy','1','1206732372QTKK'),('Delete','1','1206732372QTKL'),('Show','1','1206732372QTKM'),('Publish','1','1206732372QTKN'),('View','1','1206732388KEHZ'),('Help','1','1206732392OZUP'),('#','1','1206732392OZVA'),('Name','1','1206732392OZVB'),('Type','1','1206732392OZVD'),('Description','1','1206732392OZVG'),('Cancel','1','1206732393CXVV'),('Save','1','1206732399EINB'),('Divider','1','1206732399EINF'),('ID','1','1206732400OWXG'),('General','1','1206732400OWZR'),('Mail','1','1206732400OWZW'),('Application','1','1206732400OXBR'),('Created','1','1206732411EGRY'),('General Information','1','1206732412DABR'),('Group','1','1206732412DACD'),('Access','1','1206732412DAEO'),('File','1','1206732421RJQA'),('Location','1','1206732421RJQC'),('Default','1','1206732425HINT'),('tmid','1','1206732439BHWY'),('Date','1','1206961850KLRI'),('hidden','1','1206961869IGND'),('Core','1','1206961869IGNE'),('Form','1','1206961869IGNH'),('Order','1','1206961869IGNP'),('Size','1','1206961877KAKC'),('Back','1','1206961882TDHA'),('Code','1','1206961912MJQB'),('Coupon','1','1206961936HCWP'),('Catalog','1','1206961997BSZK'),('Upload','1','1207155379JNIN'),('Theme','1','1207306697RNME'),('Id','1','1209559181OZLK'),('Themes','1','1211811516QTEF'),('Alias','1','1211811583DBTA'),('Preview','1','1211811587EZNL'),('Themes List','1','1211907792LCMK'),('Table','1','1212662234CPQC'),('Files','1','1212761192MUSM'),('Position','1','1213695731KPWL'),('Information','1','1215507792MTRU'),('Pagination style','1','1216230542PQQX'),('<ul><li>Lean: just the page numbers</li><li>No total: standard without the total number of pages</li><li>Standard: optimal pagination</li><li>Complete: all possible buttons<br></li></ul>','1','1216230542PQQZ'),('Folder','1','1217603897AYYA'),('Buttons','1','1217603899SJDA'),('Filename','1','1217603899SJDE'),('Close','1','1228820287MBVC'),('<br><br><br>','1','1234467594BCKE'),('Edit Theme','1','1238171026KDKW'),('Breadcrumbs','1','1242282414LZMP'),('Toolbar','1','1242282435FMHV'),('Miscellaneous','1','1242282437ISFV'),('Done','1','1242282449PIPC'),('Icons','1','1242282450QJAT'),('Star Color','1','1251285854FOAP'),('Widget','1','1251697929ABZD'),('Thumbnail','1','1253939321KJPL'),('<p>Below are the list of all themes used by the installed applications. You can customize those themes as you wish. The modification will affect how the data are rendered.</p><p><strong>Note:</strong> To customize a theme you need to \"<span style=\"color:#FF0000\"><strong>CLONE</strong></span>\" to be able to edit the file. The cloned theme will be automatically set as the default theme. Cloning a theme is important so you can easily update without losing your customized code.</p><p><span style=\"color:#FF0000\"><strong>Edit Theme Button: </strong></span>You can access the theme design and customize the look and feel of your store without having to enter a single code.<br><span style=\"color:#FF0000\"><strong>Minify: </strong></span>Minify the themes to lessen the size of the file and improve page load.<br><strong>Hint:</strong></p><p>*You can\'t <strong>delete</strong> a theme which is <strong>core</strong>. You can only delete uncore theme.<br>**You can\'t <strong>unpublish</strong> a theme which is set as <strong>default</strong>. Kindly choose another one as default and then unpublish. Moreover, you can\'t set as default a theme that is not published. Kindly publish and then set as default.</p>','1','1271819049DNZB'),('Origin','1','1273655191NLYX'),('Clone','1','1298294078HATF'),('Main Files','1','1298294079SVND'),('Successfully saved the file $file','1','1298294183ETWL'),('Kindly enter a folder name','1','1298350435GKOB'),('The folder \"$folder\" already exists. Kindly enter another folder name.','1','1298350435GKOC'),('do we need to customize only one item that can be set as default?','1','1298350436LSKP'),('Folder name','1','1298350437HNTL'),('Clone Theme','1','1298350437HNTN'),('Theme main files','1','1298350437HNTO'),('Theme custom view  files','1','1298350437HNTP'),('Theme stylesheet files','1','1298350437HNTQ'),('Theme js files','1','1298350437HNTR'),('Theme Edit File','1','1298350437HNTS'),('Upload a theme','1','1298350438DLWR'),('Column 1','1','1298350843FMVJ'),('Column 2','1','1298350843FMVK'),('<p><strong>Information Tab:</strong> Short information about the theme<br />\r\n<strong>General Design Tab:</strong> You can define the general look and feel of all Application in the backend and front-end. This option is accessible through <strong>Joomla 3.2 Responsive Admin Theme</strong>.<br />\r\n<strong>Catalog Design Tab:</strong> You can customize different options to change the look and feel of your store such as button color, sizes and icons. This option is accessible through <strong>Joomla 3.2 Responsive Theme</strong>.</p>','1','1300111184CKDD'),('<p>For more information about HTML, css, etc., kindly refer to this <a href=\"http://www.w3schools.com/html/html_examples.asp\" target=\"_blank\" title=\"HTML, CSS Documentation\">documentation</a>.</p>','1','1300169727QALO'),(' Name','1','1300366591QTAJ'),(' Thumbnail','1','1300366591QTAK'),('Select Theme','1','1300366596LVYZ'),('Enter the destination folder.<br><br><br>','1','1301400667SKBF'),('Copy Theme','1','1301400668NOSW'),('','1','1304525968YBL'),('Add File','1','1306927257COUB'),('File Type','1','1306927259HYXV'),('Cart','1','1307002587NUOA'),('File already exists.','1','1307005978SBLO'),('Upload FIle','1','1307005985RRVD'),('Themes (HTML)','1','1307005986MLQD'),('Custom PHP Views (PHP)','1','1307005987LSGU'),('Stylesheets (CSS)','1','1307005987LSGV'),('Javascripts (JS)','1','1307005987LSGW'),('Destination file','1','1307005987LSGX'),('Select FIle','1','1307005987LSGY'),('Select what type of file that you are going to create.<br>','1','1307005988CSSM');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Enter the name of the file that you want to create.<br>','1','1307005988CSSN'),('Enter the destination filename for the copy.<br>','1','1307005988CSSO'),('Select what type of file that you are going to upload. The file will be uploaded in the folder that corresponds to the type of file.<br>','1','1307005988CSSP'),('Please enter another filename. <br /> You must not use the name index.','1','1307012876GLGV'),('You have selected more than one theme to clone. Only the first theme will be cloned.','1','1309502072SWIE'),('The file, $FILENAME, cannot be previewed because it is too big ( 1Mb max )','1','1316671955LOQA'),('If the theme is core you cannot edit the files. If you wish to edit the theme simply make a clone and edit the files of the clone.<br /> The cloned theme will be automatically marked as default. Click Clone button to create a clone of this theme.','1','1329173545MEGR'),('Clone of $FOLDER theme','1','1329173546QVQL'),('PHP files','1','1344051185BJJR'),('CSS files','1','1344051185BJJS'),('js files','1','1344051185BJJT'),('Theme Show File','1','1347397381CQOQ'),('Divivder','1','1360193291CNEA'),('Mobile','1','1382364838SGIL'),('column1','1','1394069593IQAS'),('column2','1','1394069593IQAT'),('The theme could not be found.','1','1395437861EIXK'),('Theme Information','1','1395886787SVIL'),('Font Awesome','1','1395886787SVIM'),('General Design','1','1395886787SVIN'),('Image Style','1','1395886787SVIO'),('Responsive Image','1','1395886787SVIP'),('Navigation Bar','1','1395886787SVIQ'),('Show Logo','1','1395886787SVIR'),('Brand','1','1395886787SVIS'),('Logo Name','1','1395886787SVIT'),('Use Colored Wizard','1','1395886787SVIU'),('Show View Icon','1','1395886787SVIV'),('Panes and Tabs','1','1395886787SVIW'),('Show Pane Icon','1','1395886787SVIX'),('Use Pane Color','1','1395886787SVIY'),('Form Direction','1','1395886787SVIZ'),('Use Fade Effects','1','1395886787SVJA'),('Use Color','1','1395886787S