rors when they occur. With this option, only guests will see the errors (you can use it when you need to see an error occurring somewhere accessible only by unregistered users like the registration page)','1','1213369263SAAF'),('Debug Errors','1','1213369263SAAG'),('Debug Queries','1','1213369263SAAI'),('Information','1','1215507792MTRU'),('The Widget was unpublished with success.','1','1215710386RMJC'),('The Widget was published with success.','1','1215710386RMJD'),('<span style=\"font-weight: bold;\">It is recommanded to use the highest level of security.</span><br>Should you want to trade some security for some performance you could lower the security level. <br>Basic security, like filter for SQL injection are always covered. <br>','1','1217930839LUIO'),('Security Level','1','1217930839LUIP'),('Performance','1','1217930839LUIR'),('Specify and email address for administration and maintenance notification.<br>If left empty all administrator will be notified.<br>','1','1217930839LUIS'),('Caching','1','1217930839LUIT'),('Pick-list','1','1219769913SSOH'),('Installation','1','1219770756BFUL'),('Translations','1','1220793710GXYB'),('A demo license could not be retrieved because you already evaluated this application on this website.','1','1227579883OZMZ'),('Grade','1','1227579895DRET');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Please use this form to contact us.  <br><ul><li>Based on your subject you will be redirected to the right section of our website: either the ticket system or the forum.</li><li>It is also important that you select the right application.</li><li>We look forward to hearing from you.</li></ul>','1','1227579895DREU'),('nestedapplication','1','1227580613HBMJ'),('nestedlanguage','1','1227580613HBMK'),('Update','1','1227580898LIDX'),('Current version','1','1228709213SHFK'),('Distribution server','1','1228820067NJRT'),('Joobi Care','1','1228820286IIZC'),('Query successfully executed!','1','1229651871ADBG'),('One of the query failed!','1','1229651871ADBH'),('List of applications updated.','1','1229651871ADBI'),('The version currently installed on your website<br>','1','1229651877RBLQ'),('The latest version available<br>','1','1229651877RBLS'),('Enter your query here.<br>','1','1229651877RBLT'),('Click Yes if you want to see the result of the query.<br><span style=\"text-decoration: underline; color: rgb(204, 0, 0); font-weight: bold;\">Warning:</span> Don\'t click Yes if you run many queries all at once.<br>','1','1229651877RBLU'),('Query','1','1229651877RBLW'),('See result','1','1229651877RBLX'),('Execute','1','1229651877RBLY'),('Application information','1','1229651878KNMW'),('<ul><li>Before installing / updating any application on the website, we recommend that you do a backup of the website files and database. This way, you will always be able to revert the changes made during the install / update in case of an error.</li><li>Setting thewebsitein maintenance mode is also recommended for updates.</li></ul>','1','1229651878KNMX'),('<ul><li>Enter the query you want to run on your server.</li><li>If you have several queries, use a semi-column ( ; ) to sepate the queries.</li><li><span style=\"color: rgb(204, 0, 0);\">Use the option to show the results only if you have few queries.</span></li></ul>','1','1229651878KNMY'),('Run Query','1','1229651878KNMZ'),('Users','1','1229653442FEQZ'),('Test email','1','1230529131MQQP'),('IP','1','1230531895KYXK'),('<span style=\"font-weight: bold; color: rgb(204, 0, 0);\">Be very careful with this feature!</span><br>The move of the license is automatic and cannot be reversed within the next 3 months.<br>Please enter the new website URL to which you want to move the license to.<br><br>','1','1230874957AEGZ'),('<ul><li>Please enter the API key you received by email or any other mean in order to get new update.</li></ul>','1','1230874957AEHC'),('<span style=\"font-weight: bold; color: rgb(204, 0, 0);\">Please be very carefull with this feature!</span><br>As specified in the license agreement a license can only be moved every 3 months. The move of the license will be automatic and irreversible within the next 3 months.<br>','1','1230874957AEHD'),('Beta','1','1231158811CQTU'),('Application in Beta','1','1232547361JEQR'),('Image Position','1','1234467597SEXO'),('Expired','1','1235461988ERWP'),('The application has been successfully set to Core.','1','1235976558LLLB'),('This application is not installed!','1','1235976558LLLC'),('Your license expired!','1','1235976558LLLD'),('Default WYSIWYG editor for the user in the front-end of the site.<br>','1','1238171067TJFA'),('download','1','1240388999GQSW'),('Confirm','1','1240912077BELS'),('News','1','1242282413PMNC'),('Memory Usage','1','1242282413PMPV'),('Last Updated','1','1242282416HAOE'),('Latest News','1','1242282417SQLW'),('Never','1','1242282417SQNR'),('Show Page Title','1','1242282435FMDW'),('Install from URL','1','1242282443EZXY'),('Uninstall','1','1242282443EZZS'),('Browser','1','1242282449PIOD'),('Done','1','1242282449PIPC'),('Media','1','1242282450QJCF'),('Show all the query executed. Only you will see them.','1','1242617238FPTQ'),('Advance feature to show the code errors when they occur. Only you will see them.','1','1242617238FPTR'),('Debug Errors Guest','1','1242617238FPTT'),('Framework','1','1243392688MXHE'),('The application has been successfully updated!','1','1245769651NPXC'),('Widget file Uploaded','1','1247466190MROL'),('Please fill one of the fields','1','1248835367AECZ'),('Install from folder','1','1248835373QZQO'),('The folder $FOLDER is not a valid extension folder','1','1248948187IFCW'),('Select the package with the browse button and click install.<br>','1','1249442155KSPX'),('Enter the URL of your package and click install.<br>','1','1249442155KSPY'),('Enter the path to the folder and click install.<br>','1','1249442155KSPZ'),('Enter package','1','1249442156QUCN'),('Recommended','1','1249442156QUCO'),('Alternative options','1','1249442156QUCP'),('Install Manager','1','1249442157SIBQ'),('It seems that the installer was unable to remove the temporary folder for install files on last install due to an access rights issue. Before trying to update/install again, please remove the folder $FOLDER via FTP.','1','1249562683MMMY'),('The file type ($FILE_EXTENSION) is not in the list of valid types : $EXTENSIONS','1','1249567958KVAQ'),('The user\'s browser has a list ofpreferredlanguages. When not logged in, this data can be use to check if those languages are available for the Joobi application and use the preferred available one. By default the Browser order is 1 which means that it\'s the first source used to decide the language to be displayed.<br>','1','1250777204RIAD'),('When the ip tracker is installed, it can detect the country where the user is by looking at his IP address. Then, the system can use the language associated with the detected country to display the joobi applications, if the language is available for joobi applications. If the ip tracker application is not installed, this option will be skipped. By default, the IP based language detection is done after the browser based detection if the browser detection was unsuccessful. Thus, its ordering value is 2 by default.<br>','1','1250777204RIAE'),('Saving of General Preferences','1','1251534480QHPE'),('This website has been added to your site manager.','1','1251770410PASS'),('This website could not be added.','1','1251770410PAST'),('Refresh all licenses','1','1251857784QRWO'),('Could not identify your website URL.','1','1251905717NHWT'),('Your website was not found. Please contract support.','1','1251905717NHWU'),('The licenses have been updated!','1','1251905717NHWW'),('There is a problem with the Localhost license.','1','1251905718PEOQ'),('The license could not be installed for $APPLICATION because the application is not yet installed.','1','1251905719IQBZ'),('The license could not be installed for application: $APPLICATION','1','1251905719IQCA'),('No licenses were found for this website.','1','1251912852OWAG'),('An error occur while installing the licenses!','1','1251959063BNBJ'),('Click Yes to force \"https\" secure internet on the Back-End.','1','1251988094BIBR'),('File Size','1','1252569179LCYI'),('File Name','1','1252569179LCYJ'),('User Logs','1','1252569179LCYK'),('User Log Details','1','1252569179LCYL'),('User Logs Details','1','1252569180FERI'),('Log Download','1','1252894206NMXU'),('User Log Delete','1','1252894206NMXV'),('Logs','1','1253200893CXZC'),('Click Yes to force \"https\" secure internet on the Front-End.','1','1254100130KOZM'),('Click No to turn off any communication with external website.<br>Note: turning this option Off will disable application updates and limit some of the functionality of the site. <br>','1','1254100130KOZN'),('Force SSL Front-End','1','1254100130KOZO'),('Force SSL Back-End','1','1254100130KOZP'),('The system can also try to use the Framework ( Joomla, Wordpress, etc ) detected language if it is available for joobi applications. By default, this is done after the other detection systems, thus, its ordering value is 3. If you set its ordering lower than the others, the system will use the framework language if available.','1','1257940976WWP'),('There are no logs available at this time. Please check again later.','1','1260434893HJHQ'),('Log file $FILE successfully deleted','1','1260434893HJHR'),('Log file cannot be previewed because it is too big (1MB max)','1','1260443578NNAV'),('Apps','1','1267607212GWJP'),('Total No. of New Apps','1','1267764045MNMG'),('Total No. Of Apps','1','1267764045MNMH'),('Apps Report Dashboard','1','1267764046CYTO');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Use this view to install packages.It can be widgets or even applications. There are three different ways to install a package.<br><ol><li><span style=\"text-decoration: underline;\">Install from package</span>: <span style=\"color: rgb(0, 102, 0); font-weight: bold;\">(Recommended)</span> Simply use the browse button to find your file on your computer and click install.</li><li><span style=\"text-decoration: underline;\">Install from an URL</span>: This can be an external URL. Enter the URL and then click install.</li><li><span style=\"text-decoration: underline;\">Install from a folder</span>: You might have the package extracted in a folder on your server , use this option to specify the folder and then click install. This option can be useful when the package is big and that your PHP upload limit is not enough or that your server times out.<br></li></ol>','1','1271818792LETO'),('Define which distribution server you want to use.<br>None: to disable updates and installs.<br>Production: <font color=\"#CC0000\">Recommended choice</font>. <br>Beta: to get latest beta releases.<br>Dev: <i>Not recommended, only use if advised by developers</i>.<br>','1','1271819434SRVJ'),('Script Type','1','1290670039OOGW'),('Your Cron Task on $HOMESITE is active and working!','1','1298294128HPXJ'),('The Cron Task on $HOMESITE could not be activated, check with support team...','1','1298294128HPXK'),('Package successfully installed','1','1298294132BJZM'),('Advance','1','1298294169DGIW'),('Total Apps','1','1298294174MWUX'),('Installed Apps','1','1298294174MWUY'),('Total No. of New Updated Apps','1','1298294174MWUZ'),('An unknown error happened while featching licenses.','1','1298350280PMMA'),('Apps Extra info','1','1298350283NKJB'),('Apps Level','1','1298350283NKJC'),('Apps Information','1','1298350283NKJE'),('Apps Translation','1','1298350283NKJF'),('Apps Level Trans','1','1298350283NKJG'),('Application Versions','1'