1','1394069593IQAT'),('Use Minified Files','1','1395437821GPTR'),('Use CDN','1','1395437821GPTS'),('CDN server','1','1395437821GPTT'),('This should <b>only</b> used for debugging purpose or development. For a production site you <b>SHOULD</b> have this option turn Off. <br><u><font color=\"#FF0000\">Warning</font></u>: revealing PHP errors might help hacker secure information about your server.<br>','1','1395437821GPTU'),('By default set to Yes, it uses the minified files for CSS ( .css ) and javascript ( .js ) rather than the original.<div>eg: style.min.css</div><div>instead of style.css</div><div>The theme files can be automatically minified in the Themes listing.</div>','1','1395437822MMRI'),('Specify the CDN server to use.','1','1395437822MMRJ'),('Turn Off logs','1','1398375022BJSW'),('Yes to turn off all recording of logs into files.','1','1398375023DTKE'),('The prefix of the API key is not valid!','1','1401297229KKPC'),('Joomla Specific','1','1406645123NWLK'),('Yes to use collapsable tree for the pick list which has values with a hierarchy.<div>No to use standard pick list tree.</div>','1','1406645123NWLM'),('Collapsable Tree Pick-list','1','1407272965STVB'),('Once a day','1','1411052474RANJ'),('Once a week','1','1411052474RANK'),('Every other day','1','1411052474RANL'),('Once a month','1','1411052474RANM');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Optimize database','1','1411052475FVUA'),('Clear cache','1','1411052475FVUB'),('Yes to allow the system to optimized the tables in the database.','1','1411052475FVUC'),('Define if the cache needs to be cleared automatically and at what frequency.','1','1411052475FVUD'),('A new application called $APPLICATION is available!','1','1413479920LDPJ'),('An update is available for $APPLICATION','1','1413479920LDPK'),('Un-minified themes could not be retreived.','1','1413490911HRES'),('API key error or not defined!','1','1415107844LLSU'),('Use 24 Hours Date','1','1416385932KENZ'),('Define how much information to display in the count down. For example:<div><ul><li>2: will show Days and Hours<br></li><li>3: will show Days, Hours and Minutes</li><li>4: will show&nbsp;Days, Hours, Minutes and Seconds</li><li>etc...</li></ul></div>','1','1416385933AEDN'),('Log Install traces','1','1416812826GUVH'),('Show Configuration','1','1416812826GUVI'),('Show Page Details','1','1416812826GUVJ'),('Enables to directly edit and customize views.','1','1416812826GUVK'),('Yes to log the installation traces.','1','1416812826GUVL'),('Display a Panel at the bottom of the page with all the Preferences used to display the page.','1','1416812826GUVM'),('Display a Panel at the bottom of the page with all the information regarding the page.','1','1416812826GUVN'),('If the Itemid is not defined in the page, the specified value will be used.<br>Can be useful to avoid a link to render the front-end page modules.<span style=\"font-weight: bold;\"><br></span>','1','1418159312IWLR'),('<br><span style=\"font-style: italic; text-decoration: underline; font-weight: bold;\">About Update and Install:</span><br><ul><li>First click on <span style=\"font-weight: bold;\">Check</span> to get an updated list of all Applications available.</li><li>To install or update an application click on the <span style=\"font-weight: bold;\">Name</span> of the application you want to install.  You will be redirected to the main page of the application.</li><li>To change the grade of an application, click on the link in the <span style=\"font-weight: bold;\">Grades</span> column.</li></ul><span style=\"text-decoration: underline; font-style: italic; font-weight: bold;\">About License:</span><br><ul><li>If you have a token you can simply click on <span style=\"font-weight: bold;\">Enter token</span> and follow instruction.</li><li>You can use the button <span style=\"font-weight: bold;\">Refresh</span> to refresh all your licenses. It will re-actualize all your licenses.<br></li></ul>','1','1418159313RUIV'),('This is a list of all possible translation in any installed language:<br><br>1. To find your translation first select the proper language in the pick-list.<br>2. Choose your application<br>3. Click on the \"Edit\" button to edit the translation.<br>4. In case you do not find the proper string look for it in the main library in jCenter or jApps.<br><br>','1','1418159313RUIW'),('<p style=\"line-height: 1.4em;\">Please note that the site where you enter the API key FIRST will be the only site you are entitled for free support. <br>If you have a production site and a development site you need to decide if you prefer getting support for the production site or for the development site.<br>It is not possible to change the site on which you get primary support at a later time.<br> Should you have further question please <a target=\"_blank\" href=\"https://www.joobi.co/r.php?l=support\">contact the support.</a><br></p>','1','1418159317GYIO'),('Impossible to publish Widget without the application \"$APLLICATION\" installed on the site.','1','1418159318SHOQ'),('Choose','1','1421617710FQCB'),('Uninstall App','1','1421617712NRTN'),('Uninstall Only One App','1','1421617713IRWT'),('Uninstall All Apps','1','1421617713IRWU'),('Remove All Apps and All Data in Database','1','1421617713IRWV'),('Show hidden views','1','1422973803PSLT'),('Show the line number into the log.<div>This require a lot more memory. Use only in debug mode and make sure you have sufficient memory.</div>','1','1422973804PMJX'),('Fields for All Models','1','1423597825SYTZ'),('Allow to use custom field for sorting.<br>If not used, disable for performance purpose.','1','1423597826QYJU'),('Default Page Id','1','1425339791AULI'),('No query has been defined!','1','1425662174IZVW'),('Social Media','1','1425956837EQIA'),('The author of the application','1','1426511377ENBT'),('Not available at the moment. Please check back later.','1','1426726331GHCC'),('Release Notes','1','1426726336DHKC'),('Load jQuery','1','1426800196HAOH'),('This is to load mootools first before you load jquery.','1','1426800196HAOI'),('Retrieving list of packages...','1','1427652792LBWK'),('Initialization','1','1427652792LBWL'),('Downloading packages','1','1427652792LBWM'),('Extracting packages...','1','1427652792LBWN'),('Extracting packages','1','1427652792LBWO'),('Moving files...','1','1427652792LBWP'),('Moving files','1','1427652792LBWQ'),('Creating tables','1','1427652792LBWR'),('Running custom install...','1','1427652792LBWS'),('Running custom functions','1','1427652793DOXK'),('All custom function run!','1','1427652793DOXL'),('Installing languages','1','1427652793DOXM'),('All languages downloaded!','1','1427652793DOXN'),('Finalization','1','1427652793DOXO'),('Install complete and successful!','1','1427652793DOXP'),('Show Install details','1','1427652796LGUR'),('Yes to display the install details','1','1427652797LLYT'),('Go setup','1','1427833134LQDZ'),('Update Check','1','1428084291QKNE'),('Show Support Chat','1','1428084291QKNF'),('Click Yes if you want to see the wizards for each view.','1','1428084291QKNG'),('Check & Download','1','1428084293SVQZ'),('There is no new package to install','1','1428532729DJHL'),('Return to Apps\' list','1','1429064415HVOW'),('No packages found!','1','1429238504IKNA'),('Install download folder reset successfully!','1','1429564804LHII'),('Clean Downloads','1','1429564806LXTQ'),('Reset Install','1','1429564806LXTR'),('Delete the install downloads files.','1','1429564807KXRS'),('No widget ID defined','1','1431936850KAHW'),('loading data, please wait...','1','1432148472FAJB'),('Click here to check on the requirements.','1','1432597449CAIM'),('The minimum requirements are not met, the installation cannot proceed.','1','1432597449CAIN'),('php-xml extension is not installed in your PHP server, it is highly recommanded.','1','1433250437OEYO'),('Reset the custom translations. <br><u><font color=\"#990000\">Danger:</font></u> by activating this button all the custom translation you entered will be removed and reset to original translations. If the button is click by accident, download your translation before updating any App.<br><u><font color=\"#000099\">Hints: </font></u>Once click on this button it is still necessary to update the Apps to refresh the translations.','1','1436323210NDIP'),('Count Down Precision','1','1439992929HQVH'),('Yes to 24 hours style for the time rather than 12 hours AM / PM','1','1439992930ADCG'),('Please make sure you install the other languages. Go to jApps -> Tools -> Languages , click \"Synchronize\" and then install the new languages.','1','1440630075DQTP'),('DB engine','1','1440702675NONN'),('Choose the DB engine to use.','1','1440702676MDAP'),('<p><span style=\"color:rgb(0, 102, 204)\">Test e-mail:</span> this button enables you to test the email settings.<br />\r\nAn email will be sent to your email address based on the default server configuration.<br />\r\n<br />\r\n<strong>Scheduler </strong><br />\r\nThe tasks can be executed with a specific frequency ( for example every Day ) or at a specific date in the future.<br />\r\n<br />\r\n<strong>How does it work?</strong><br />\r\nTo launch those scheduled tasks, the scheduler needs to be triggered by something...</p>\r\n\r\n<ul>\r\n	<li>Any visit on your website can trigger the system (so no visit means no task run!)<br />\r\n	In that case you have to turn ON the option &quot;User Cron System&quot;.</li>\r\n	<li><strong>OR</strong> an external system can trigger the scheduler application by accessing the cron url. Check the General Preferences -&gt; Scheduler for the exact URL.\r\n	<div><em>(enter the password if you have set one. Copy/paste this url on your browser to see if the scheduler application get launched properly)</em></div>\r\n	<br />\r\n	This second solution is recommended as the system will be launched at fixed dates and won&#39;t depend on your website traffic.<br />\r\n	In that case you can turn OFF the option &quot;User Cron System&quot;.</li>\r\n</ul>','1','1440770598FNPL'),('Once you have install the other languages you can turn off the preferences \"Force English Back-end\" and turn on \"Multilingual Content Site\", in the jApps -> Preferences -> Advance -> Languages to make these messages disappear.','1','1441038141CRZK'),('Up to date','1','1441368075IKSL'),('Loading Feed...','1','1442253312FRLP'),('Allow Fields Sorting','1','1443147198KXXZ'),('Allow the same field to be added on all <b>related models</b>.<br><b>Related models</b> are model which share the same table.&nbsp; When looking at the list of models you will see the table name.<br><u>E.g.</u>: the same field could be added to users and contacts model since they share the same table. It can\'t be added to vendors since it is another table.','1','1443147199IQLJ'),('Communication Timeout','1','1444070844HEHJ'),('Define the timeout of external communication.','1','1444070846KOAI'),('Maps','1','1445011870LTGA'),('Default Zoom','1','1445011870LTGB'),('Specify the value of the default zone on maps','1','1445011871AMDU'),('Reset Translations','1','1446563058FBIJ'),('Reset the install if it stop or failed.<br>Do not click on this while an install is going on.','1','1446563059FXUG'),('Could not upload the ini file!','1','1446691217SHNF'),('Upload Translation','1','1446691221FPNC'),('A new distribution site has been found, however before you can switch to the new one, you need to update all your Apps to the latest version!','1','1448462950OCEG'),('Before a new distribution site can be found you need to update all your Apps to the latest version!','1','1448462950OCEH'),('Edit Distribution Site','1','1448564355OLFC'),('The server which is contacted to install or updates production releases.','1','1448564356ONYE');
