INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Yes','1','1206732372QTKI'),('No','1','1206732372QTKJ'),('Item','1','1206732372QTKR'),('Help','1','1206732392OZUP'),('Translation','1','1206732392OZUR'),('Languages','1','1206732392OZUS'),('#','1','1206732392OZVA'),('Name','1','1206732392OZVB'),('Description','1','1206732392OZVG'),('Status','1','1206732392OZVH'),('status','1','1206732392OZVI'),('Cancel','1','1206732393CXVV'),('Hide/show status','1','1206732398LZKD'),('Save','1','1206732399EINB'),('Divider','1','1206732399EINF'),('ID','1','1206732400OWXG'),('Direct Edit','1','1206732400OWXQ'),('Text','1','1206732400OWYY'),('Application','1','1206732400OXBR'),('Your translation file has been successfully sent to Joobi Team.  The file will be included in the next release.','1','1206732404ORZG'),('The provided file is not an ini file and cannot be imported.','1','1206732404ORZN'),('List of Translation','1','1206732404ORZX'),('Import','1','1206732405TIXA'),('Export','1','1206732405TIXB'),('Vocabulary','1','1206732405TIXD'),('Language','1','1206732405TIXE'),('Load the file containing the translation of the application','1','1206732405TIXI'),('Admin','1','1206732425HINY'),('Site','1','1206961849MVDJ'),('hidden','1','1206961869IGND'),('Back','1','1206961882TDHA'),('Code','1','1206961912MJQB'),('Available','1','1206961996STAF'),('Origin Language','1','1208950213FHRP'),('Destination Language','1','1208950213FHRR'),('Synchronize','1','1209481169RSAA'),('Language Import','1','1210244259NSAY'),('Import a language file','1','1210244259NSBA'),('Language Export','1','1210244259NSBB'),('Export a language file','1','1210244259NSBD'),('Languages list','1','1210244259NSBF'),('English','1','1210244259NSBG'),('Native','1','1210244259NSBH'),('Language File to Import','1','1210244259NSBI'),('This view shows a list of languages.  If the language is marked as \"Available\" then this language is available on your site.<br>Please note that a language available does not necessarily means that it is available for all applications.<br><br>The columns \"Site\" and \"Admin\" indicate if the language is available on for the CMS respectively in the front-end (Site) or back-end (Admin) of the website.<br><br><span style=\"text-decoration: underline; color: rgb(0, 0, 153);\">MENU:</span> <br><ul><li>The \"<span style=\"font-weight: bold;\">Synchronize</span>\" button enables you to synchronize the languages available with the CMS.</li><li><span style=\"font-weight: bold;\">Export</span>: use to export the language file for an application so that you can edit the translation.</li><li><span style=\"font-weight: bold;\">Import</span>: use to import the modified language file.<br></li></ul>','1','1212843247FGZJ'),('Thank you very much for your contribution!','1','1213020853MLHS'),('The list of available languages has been synchronized with the site.','1','1213107637HXCR'),('Specify the language you want to take as the origin language from which you want to translate.','1','1213107638BOKE'),('Specify the language in which you want to translate the application.<br />It is important that you specify this language so that we can optimize the exported file so that you do not have to translate something which is already translated.','1','1213107638BOKF'),('There was an error sending the file.  Please send the file by email to: $EMAIL .','1','1213285236EJWF'),('This language is already available in the general release for this application. The translation was not sent.  If you feel like the translation need to be corrected and you want to submit your file please send it to the Joobi Team by email at: $EMAIL .','1','1213285236EJWG'),('Automatic Translation','1','1219769913SSNZ'),('Translations','1','1220793710GXYB'),('Specify the format you want to export your data:<br><ul><li>ini file</li><li>html file<br></li></ul>','1','1222791260AEAH'),('This form enables you to create a language file, so that you can translate the file and then import it.<br><ol><li>Select the original language.  <br></li><li>Define the language in which you want to translate.</li></ol><span style=\"text-decoration: underline; color: rgb(0, 0, 255);\">NOTE:</span> The best <span style=\"font-weight: bold;\">original language</span> to choose is <span style=\"font-weight: bold;\">English</span> since all application have originally been developed in English.  If you take any other language you might translate something which has already been translated and therefore <span style=\"font-style: italic;\">loose accuracy</span>.','1','1222791260AEAI'),('Use this form to import a language file.  The file should be in the same format as it has been exported with the Export menu.<br><ul><li>After importing your language file, you may want to share your translation with the community... To do so, please click on the button \"Share\".<br></li></ul>','1','1227580115NTZD'),('Language already translated','1','1227580123BQHZ'),('Translation file Uploaded','1','1227580123BQIA'),('Close','1','1228820287MBVC'),('Auto','1','1230531895KYXL'),('Automatic','1','1231731000EGWA'),('Translations successfully installed','1','1239875557LNEW'),('Dictionnary successfully loaded','1','1240842525LJTR'),('Format','1','1242282414LZMG'),('Done','1','1242282449PIPC'),('Select the language for which you would like to translate.','1','1242822624LPVI'),('Select the application you want to export<br>','1','1243437923JGCO'),('Click here to go back to the languages listing','1','1260151166CSBW'),('Language installation completed','1','1260151224KRNI'),('Looking for translations...','1','1260151224KRNJ'),('install','1','1260151225DTCK'),('Language install','1','1260151225DTCL'),('translation_install','1','1260151226HJVF'),('translation_installexec','1','1260151226HJVG'),('There are no logs available at this time. Please check again later.','1','1260434893HJHQ'),('The following model or table does not exist :$MODEL','1','1299160210HQTQ'),('Specify if you want to export all strings or onl